import React from 'react';

const Signup = () => {
    return (
        <>
            <div className="signup">
                <div className="signup-text">
                    <h1>Sign Up to</h1>
                    <h2>Our Website</h2>
                    <p> If you aready have an account you can Login here!</p>
                </div>
            </div>
        </>
    )
}

export default Signup
